import axios from 'axios'
import React, { useEffect, useState } from 'react'

const signIn = () => {

    const [users, setusers] = useState([])
    useEffect(() => {

        axios.get('http://localhost:5000/user')
            .then((res) => {
                setusers(res.data)
                console.log(users)
            })
            .catch((err) => console.log(err))

    }, [])
    return (
        <div>
            <h1>hello in sign in</h1>
        </div>
    )
}

export default signIn
